import c from './AllPosts.module.css';
import Post from './post/Post';
import React from 'react';

const AllPosts = (props) => {

    let allPostsData = [
        {id:1, username: "Pavel", title: "Пост 1", text: "Текст", likes: 12, dislikes: 3},
        {id:1, username: "Petr", title: "Пост 2", text: "Текст", likes: 16, dislikes: 5},
        {id:1, username: "Dima", title: "Пост 3", text: "Текст", likes: 21, dislikes: 8},
        {id:1, username: "Anton", title: "Пост 4", text: "Текст", likes: 16, dislikes: 2},
    ]

    return(
        <div className={c.AllPosts}>
            <Post username="Pavel"/>
            <Post username="Petr" />
            <Post username="Dima" />
            <Post username="Anton" />
        </div>
    );
}

export default AllPosts;
